package main

import (
	"fmt"
)

func lemonadeChange(bills []int) bool {
	fiveCount := 0
	tenCount := 0
	twentyCount := 0

	acceptPay := func(bill int) bool {
		switch bill {
		case 5:
			return true
		case 10:
			if fiveCount > 0 {
				fiveCount--
				return true
			} else {
				return false
			}
		case 20:
			if fiveCount > 0 && tenCount > 0 {
				tenCount--
				fiveCount--
				return true
			} else if fiveCount > 2 {
				fiveCount -= 3
				return true
			} else {
				return false
			}
		default:
			return false
		}
	}

	for _, bill := range bills {
		switch bill {
		case 5:
			fiveCount++
		case 10:
			if acceptPay(10) {
				tenCount++
			} else {
				fmt.Println(fiveCount, tenCount, twentyCount, " change for 10")
				return false
			}
		case 20:
			if acceptPay(20) {
				twentyCount++
			} else {
				fmt.Println(fiveCount, tenCount, twentyCount, " change for 20")
				return false
			}
		default:
			continue
		}
	}
	return true
}

